function Intro() {
    return (
      <div className="Intro">
          <h1>JUNIOR FULL STACK DEVELOPER</h1>
          <img className="profile-photo" src={"../tiago_costa.jpeg"} alt={"Tiago Costa"}/>

          <h3>About me</h3>
          <p>Extremely motivated to constantly develop my skills and grow professionally. 
I am confident in my ability to come up with interesting ideas for every challenge that I'm faced with.</p>
      </div>
    );
  }



export default Intro;
